import Header from './components/Header';
import Main from './components/Main';



function App() {
  const title = 'React Overview'
  const fruits = ["apple", 'orange', 'grape', 'tomato']

  return (
    <>
      <Header />

      <ul>
        {fruits.map((fruit) => {
          return <li>{fruit}</li>
        })}
      </ul>
      {}

      <Main title={title} />
    </>

  );
}

export default App;
